    <style>
        body {
            font-size: 15px;
            display: flex;
            box-sizing: border-box;
            margin: 0;
            padding: 0;
        }

        #app {
            flex: 1 1 40%;
            padding: 50px;
        }

        .ms-Stack {
            display: flex;
            flex-flow: column nowrap;
            width: auto;
            height: auto;
            box-sizing: border-box;
            align-items: center;
        }

        .ms-Stack--shadow {
            padding: 25px;
            box-shadow: rgb(0 0 0 / 40%) 0px 0px 5px 0px;
        }

        .ms-Button--primary {
            outline: transparent;
            position: relative;
            font-family: "Segoe UI", "Segoe UI Web (West European)", "Segoe UI", -apple-system, BlinkMacSystemFont, Roboto, "Helvetica Neue", sans-serif;
            -webkit-font-smoothing: antialiased;
            font-size: 14px;
            font-weight: 400;
            box-sizing: border-box;
            border: none;
            display: inline-block;
            text-decoration: none;
            text-align: center;
            cursor: pointer;
            vertical-align: top;
            padding: 0px 16px;
            border-radius: 2px;
            min-width: 80px;
            height: 32px;
            background-color: rgb(0, 120, 212);
            color: rgb(255, 255, 255);
            user-select: none;
        }

        .ms-Button--default {
            outline: transparent;
            position: relative;
            font-family: "Segoe UI", "Segoe UI Web (West European)", "Segoe UI", -apple-system, BlinkMacSystemFont, Roboto, "Helvetica Neue", sans-serif;

            cursor: pointer;
            vertical-align: top;
            padding: 0px 16px;
            border-radius: 2px;
            min-width: 80px;
            height: 32px;
            background-color: rgb(255, 255, 255);
            color: rgb(50, 49, 48);
            font-style: oblique;
            user-select: none;
        }

        a {
            color: #0067b8;
            text-decoration: none;
        }

        a:hover {
            text-decoration: underline;
        }
